import React from "react";

const List = (props) => {
    const { contents } = props;
    if (!contents || contents.length === 0) return <h1>No hay peliculas</h1>

    return (
        <ul>
        <h2 className="Second-Title">Estas son las peliculas disponibles</h2>
        <table>
            <tr>
                <th>Id</th>
                <th>Nombre</th>
                <th>Anno</th>
                <th>Id del director</th>
                <th>Nombre</th>
                <th>Apellido</th>
            </tr>   
            {contents.map((content) => {
                return (
                    <div style={{background: "yellow", margin: "10px"}}>
                            <span className="Component-Title">{content.id}</span>
                            <span className="Component-Title"><b>  </b> {content.name}</span>
                            <span className="Component-Title"><b>  </b> {content.year}</span>
                            <span className="Component-Title"><b>  </b>{content.director_id}</span>
                            <span className="Component-Title"><b>  </b>{content.director_first_name}</span>
                            <span className="Component-Title"><b>  </b>{content.director_last_name}</span>
                    </div>

                );
            })}
        </table>

        </ul>
    );

};

export default List;
